import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return(
    <div className="ui secondary pointing menu">
      <div className="right menu">
        <div class="item">
          <i class="home icon"></i>
        </div>
      </div>
    </div>
  );
}

export default Header;
